eters which are configurable for the strategy\n    params = dict(\n        pfast=10,  # period for the fast moving average\n        pslow=30   # period for the slow moving average\n    )\n\n    def __init__(self):\n        sma1 = bt.ind.SMA(period=self.p.pfast)  # fast moving average\n        sma2 = bt.ind.SMA(period=self.p.pslow)  # slow moving average\n        self.crossover = bt.ind.CrossOver(sma1, sma2)  # crossover signal\n\n    def next(self):\n        if not self.position:  # not in the market\n            if self.crossover &amp;gt; 0:  # if fast crosses slow to the upside\n                self.buy()  # enter long\n\n        elif self.crossover &amp;lt; 0:  # in the market &amp;amp; cross to the downside\n            self.close()  # close long position         \n\n&lt;/code&gt;&lt;/pre&gt;\n\n&lt;hr /&gt;\n\n&lt;h1&gt;Data Feeds&lt;/h1&gt;\n\n&lt;h2&gt;YahooFinanceCSVData&lt;/h2&gt;\n\n&lt;table class=\"metaDataTable\"&gt;\n&lt;thead&gt;\n&lt;tr&gt;\n  &lt;th&gt;Property&lt;/th&gt;\n  &lt;th&gt;Value&lt;/th&gt;\n&lt;/tr&gt;\n&lt;/thead&gt;\n&lt;tbody&gt;\n&lt;tr&gt;\n  &lt;td&gt;DataName:&lt;/td&gt;\n  &lt;td&gt;EURUSD.txt&lt;/td&gt;\n&lt;/tr&gt;\n&lt;tr&gt;\n  &lt;td&gt;Timezone:&lt;/td&gt;\n  &lt;td&gt;None&lt;/td&gt;\n&lt;/tr&gt;\n&lt;tr&gt;\n  &lt;td&gt;Number of bars:&lt;/td&gt;\n  &lt;td&gt;648&lt;/td&gt;\n&lt;/tr&gt;\n&lt;tr&gt;\n  &lt;td&gt;Bar Length:&lt;/td&gt;\n  &lt;td&gt;1 Day&lt;/td&gt;\n&lt;/tr&gt;\n&lt;tr&gt;\n  &lt;td&gt;Time From:&lt;/td&gt;\n  &lt;td&gt;2018-01-01 00:00:00&lt;/td&gt;\n&lt;/tr&gt;\n&lt;tr&gt;\n  &lt;td&gt;Time To:&lt;/td&gt;\n  &lt;td&gt;2020-06-25 00:00:00&lt;/td&gt;\n&lt;/tr&gt;\n&lt;/tbody&gt;\n&lt;/table&gt;\n\n&lt;hr /&gt;\n\n&lt;h1&gt;Observers&lt;/h1&gt;\n\n&lt;h2&gt;Broker&lt;/h2&gt;\n\n&lt;table class=\"metaDataTable\"&gt;\n&lt;thead&gt;\n&lt;tr&gt;\n  &lt;th&gt;Parameter&lt;/th&gt;\n  &lt;th&gt;Value&lt;/th&gt;\n&lt;/tr&gt;\n&lt;/thead&gt;\n&lt;tbody&gt;\n&lt;tr&gt;\n  &lt;td&gt;fund&lt;/td&gt;\n  &lt;td&gt;None&lt
